using ClashRoyale.Logic;
using ClashRoyale.Utilities.Netty;

namespace ClashRoyale.Protocol.Messages.Server
{
    public class HomeBattleReplayDataMessage : PiranhaMessage
    {
        public HomeBattleReplayDataMessage(Device device) : base(device)
        {
            Id = 24114;
            Device.CurrentState = Device.State.Battle;
        }

        public override void Encode()
        {
            Writer.WriteVInt(159541); // Compressed Length
            Writer.WriteInt(2090); // Decompressed Length

            //Writer.WriteInt(725549056);
            Writer.WriteIntLE(16171);

            // Decompressed:
            //Writer.WriteHex(
            //"");

            // Compressed:
            Writer.WriteHex("");
        }
    }
}